import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Ampoulecamera = () => {
    const [produit_json, setProduit] = useState("")
    const [categorie, setCategorie] = useState("")
    useEffect(async() => {
        console.log('produit definit')
        var url = "http://localhost:8000/produit/1"

        let d = await fetch(url).then(response => {
            if(response.ok) {
                console.log("fetch")
                return response.json();
            } 
            else {
                console.log(response,'Mauvaise réponse du réseau');
            }
            }).then(data =>{
                return(data)
            })
            .catch(function(error) {
            console.log('Il y a eu un problème avec l\'opération fetch: ' + error.message);
            });
            setProduit(d)
            setCategorie(d.categorie)
            console.log('ddddddddddddddddddddddddddaaa0153',d.categorie)
        
    }, []);
    return (
        <div className="accueilBannInv w-100 position-relative" style={{background : "black", height:'600px'}}>
                    
            <video autoplay muted loop id="myVideo">
            <source src="rain.mp4" type="video/mp4"/>
            </video>

            <h2 className="bannTitre" style={{color : 'white'}}>
                Service d'nstallation de caméras 
            </h2>
            <h4 className="bannSoustitre" style={{color : '#ddd'}}>
                Que ce soit pour votre domicile ou pour votre boutique faite nous confiance pour mettre en place votre dispositif de caméras de surveillance
            </h4>
            <div className="d-flex justify-content-center align-items-center w-100">
                        <Link to={`/produit/${produit_json.id}`}  className="bannLink bannBtn">
                            Nous contacter 
                        </Link>                    

                        <Link to={`/categorie/${categorie.id}`}  className="bannLink text-center">
                            En savoir plus sur l'installation de caméra
                        </Link>   

            </div>
        </div>
    );
}

export default Ampoulecamera;
